INSERT INTO `specialsoftware_reacties` (`id_reactie`, `nummer`, `tijd`, `naam`, `tekst`) VALUES
(54, 1, '2026-02-23 20:46:01', 'Hans Eekels', 'Goed nieuws ! Ik heb een opvolger gevonden die mijn programma\'s \r\noverneemt en ze binnenkort in een aangepaste en moderne versie zal \r\naanbieden. Gebruikers krijgen daar uiteraard binnenkort nog meer \r\ninformatie over. Zie ook de aparte pagina \"Laatste Nieuws\".'),
(55, 2, '2026-02-26 17:31:08', 'Kees ', 'Dat is goed nieuws Hans,  het is een heel prettig programma om mee te \r\nwerken. Hopelijk kunnen we weer jaren vooruit.');
INSERT INTO `eekels_nieuws` (`nieuws_id`, `nummer`, `tijd`, `kop`, `tekst`) VALUES
(5, 5, '2025-05-11 21:21:52', 'Glasvezel', 'Nadat Open Dutch Fiber ons 2 jaar geleden plechtig had beloofd dat we gratis op \nglasvezel aangesloten konden worden (maar dat niet kon waarmaken en het \naansluitpunt nu 15 meter vanaf de voordeur in een gemeenschappelijke \nbezemkast heeft opgehangen), is nu de KPN aan zet. Ook die legt een \nglasvezelnet aan (naast die van ODF), ook die belooft al 5 maanden \nelke week dat we gratis worden aangesloten, maar ook die tech-gigant \nkrijgt het niet voor elkaar om een aansluitpunt in onze meterkast te \nplaatsen. We wachten nu totdat er glasvezel wordt aangelegd door Ziggo, \nBudget, Online, Youfone of Odido. Of Starlink natuurlijk, maar dan moet ik ook weer een sticker kopen &#128519'),
(6, 6, '2025-05-15 12:29:53', 'Gastles', 'Ik ben weer gevraagd om een gastles &quot;voorbereiding voortgezet onderwijs&quot; \r\nte geven in groep 8 op de Anjelier van kleinzoon Mick. Leuk: ik denk dat \r\nik dit jaar kleinzoon Kai meeneem (die gaat in september technische \r\nwiskunde studeren in Delft), zodat de kinderen dan kunnen kiezen of ze \r\nwat meer willen weten van de relativiteitstheorie van Einstein of van de \r\nkwantummechanica van Schrödinger. Altijd leuk om een kat in een zak rond \r\nte slingeren (volgens de wetten van Einstein) en dan de klas te vragen \r\nof de kat dood is of nog leeft (volgens de wetten van Schrödinger).'),
(7, 7, '2025-06-12 22:09:47', 'Rugzak aan de vlaggenmast', 'Vandaag 2 kleinzonen geslaagd voor het voortgezet onderwijs. Proficiat ! \r\nIn de komende jaren nog 6 te gaan; succes !'),
(8, 8, '2025-06-21 23:38:44', 'Collabday', 'Op verzoek van de organisator van de Microsoft gerelateerde conferentie \r\nCollabdays (te weten mijn zoon Maarten) twee voordrachten gehouden voor \r\nde kinderen die door de conferentie-gangers waren meegenomen. Leuke \r\nochtend !'),
(9, 9, '2025-07-07 10:43:27', 'Alternatieve feiten op school?', 'Als gepensioneerd civiel ingenieur die nog onbezoldigd gastlessen \r\ngeeft op basisscholen, zie ik met verbijstering dat overal op het \r\nprimair onderwijs de kilogram als standaard eenheid van gewicht wordt \r\ngebruikt. Dat is pertinent onjuist. De kilogram is de eenheid van \r\nmassa; de Newton N is de eenheid van kracht en gewicht.\r\nHet grote probleem van deze volstrekt onjuiste voorstelling van zaken \r\nis:\r\na) dat het aan kinderen nauwelijks uit te leggen is waarom iemand op \r\nde maan 6 kilo weegt als hij op aarde 24 kilo weegt;\r\nb) dat leerlingen die de techniek ingaan, tot hun verbijstering horen \r\ndat een auto geen 1200 kg weegt (zoals ze altijd is verteld), maar \r\n12.000 N.\r\nHet feit dat een zak aardappelen bij AH 1 kg weegt (en niet 10 Newton \r\nzoals het zou horen) doet niets af van de plicht van de overheid om \r\nonze kinderen de juiste eenheden te leren en doet zeker niets af van \r\nde plicht van de Pabo om leerkrachten af te leveren die meer kennis \r\nhebben dan de alchemisten uit de Middeleeuwen !'),
(11, 11, '2025-08-31 22:07:24', 'Robbert Dijkgraaf Essay 2025', 'Je kunt als student, afgestudeerde of alumni meedoen aan de Robbert \r\nDijkgraaf Essayprijs 2025 die toegekend zal worden tijdens het Gala van \r\nde Wetenschap op 25 november in Amsterdam. Ga naar <a href= \r\n\"https://www.galavandewetenschap.nl/\" target=\"_blank\">Info</a> voor \r\ninfo en het inschrijf formulier. Ik heb ook wat ingezonden; als ik bij de beste 3 hoor, laat ik dat hier weten :)'),
(12, 12, '2025-09-01 14:20:02', 'Eindelijk glasvezel', 'Aan de soap rond het aansluiten van onze appartementen op glasvezel is \r\nin ieder geval voor de provider KPN een einde gekomen: we hebben \r\nglasvezel !! Vooraf uiteraard even een snelheidstestje gedaan: Uploaden \r\n30 Mbps en Downloaden 88 Mbps. Was zeker niet slecht maar nu Uploaden \r\n213 Mbps en Downloaden 188 Mbps. Het scheelt dus wel en dat voor \r\ndezelfde prijs. Ook nog even, op advies van de buurman, het tv-kastje \r\nvan de KNP weggegooid en overgestapt op de KPN-app op onze smart-tv. \r\nScheelt een hoop kabels in huis en ook nog maar één afstandsbediening. \r\nWij zijn er blij mee. Nu nog wat verzinnen voor de caravan.'),
(13, 13, '2025-09-26 10:00:21', 'Campingseizoen afgelopen', 'Zo, na een fantastisch seizoen de caravan weer winterklaar gemaakt. Om \r\nwat te doen te hebben in de winterperiode, heb ik het boekje \"De Riemann \r\nhypothese\" aangeschaft. De Riemann-hypothese is een veronderstelling die \r\nstelt dat alle niet-triviale nulpunten van de Riemann-zetafunctie een \r\nreëel deel van 1/2 hebben. Eens kijken of ik dat snap en kan bewijzen \r\ndat de hypothese klopt. Levert onmiddellijk 1 miljoen dollar op. De \r\nhypothese is al 166 jaar oud, maar met een kleinzoon die wiskunde \r\nstudeert in Delft moet dat toch een eitje zijn. Lukt dat niet de komende \r\nmaanden, dan ga ik misschien een programma schrijven om de Bingo op de \r\ncamping te automatiseren :)'),
(14, 14, '2025-12-16 09:14:07', 'Op naar 2026', 'Even terugkijkend, is 2025 best wel een mooi jaar geweest. Mooi camping-seizoen, bijna alle \r\nkleinkinderen zijn nu groter dan hun opa en oma, alle kinderen hebben een eigen huis en zelf \r\nmaken we het ons steeds makkelijker met in hoogte verstelbare fauteuils en bedden. Mijn \r\nbiljartprogramma’s worden door honderden clubs gebruikt en Gerda heeft haar haakwerk tot \r\nkunst verheven. Alles positief dan ? Nee, zo zit het leven niet in elkaar. Tata stoot nog steeds \r\ngif uit, Oekraïne vecht een ongelijke strijd en de politieke verschuiving in ons polderlandje \r\nwordt zelfs op de A9 zichtbaar als ik rechts wordt ingehaald. Maar we klagen niet en kijken \r\nsamen uit naar een mooi 2026. Tip voor oudejaars avond: pas nog één keer goed op je ogen !'),
(15, 15, '2026-01-09 17:06:22', 'Intuïtionisme', 'Ik heb mij \"bekeerd\" tot het Intuïtionisme. Dat klinkt sekte-achtig, \r\nmaar dat is het niet. Het is een stroming binnen de wiskunde, als \r\ntegenhanger van de formele wiskunde. Vooral een compleet andere kijk op \r\nhet begrip \"oneindig\" en de \"constructieve algoritmes\" die veelal als \r\neis gesteld worden bij het beschrijven van wiskundige modellen \r\n(verzamelingen, reeksen e.d.) spreken mij bijzonder aan. Ik heb er een \r\naparte pagina aan gewijd en heb daarop mijn eerste artikel geplaatst waarin ik de diagonaal-paradox van Cantor naar het rijk der fabelen verwijs.');
INSERT INTO `eekels_reacties` (`id_reactie`, `nummer`, `tijd`, `naam`, `tekst`) VALUES
(14, 1, '2025-05-15 13:33:45', 'Kai', '		Gelukkig kijk dagelijks voor nieuwe nieuws items, zo kom ik erachter dat \r\nik mee mag een gastles te geven voordat ik ben gevraagd!		'),
(17, 2, '2025-06-30 13:55:59', 'Hans', 'Lopen twee meisjes van ongeveer 4 jaar, zij aan zij, langs onze caravan \nover het pad. Zegt de ene tegen de andere: &quot;Loop ik nu eigenlijk met jou \nmee, of loop jij met mij mee?&quot; Tja, dat zijn toch behoorlijke \nfilosofische vragen &#128522;'),
(31, 3, '2025-06-30 16:32:51', 'Hans', 'Als je nu een reactie plaatst, kun je ook een emoji toevoegen. Niet echt \nspannend tegenwoordig, maar wel leuk voor mij om \'t te programmeren &#128522;'),
(32, 4, '2025-08-25 20:22:54', 'Hans Eekels', 'Nog even komkommertijd &#128512;; een easter egg &#10067; achter een dubbel click '),
(33, 5, '2025-08-26 12:16:27', 'Kai', 'Leuk gedaan hoor&#128077;'),
(34, 6, '2026-01-21 17:25:24', 'Hans Eekels', 'Via de knop Programma\'s kun je nu ook Priemgetallen vinden tussen 10 en \r\n10.000.000.\r\nLeuke weetje: de priemgetallen worden getoond in regels met het zelfde \r\nhonderdtal. Ik heb ontdekt dat er geen enkel priemgetal te vinden is \r\ntussen 3.117.300 en 3.317.400 en tussen 3.933.600 en 3.933.700');
